pragma solidity ^0.5.16;

import "./TokenStorage.sol";

contract MCCToken  {
    TokenStorage tokenStorage;
    address tokenStorageAddress = 0x2FF10521817dFa33AE9bA1931B7a414E60B2a76C;
    event Transfer(address indexed _from, address indexed _to, uint _value);
    event Approval(address indexed _owner, address indexed _spender, uint _value);

    constructor() public{
        tokenStorage = TokenStorage(tokenStorageAddress);
    }

    function totalSupply() public view returns (uint) {
        return tokenStorage.getTotalSupply();
    }

    function balanceOf(address _addr) public view returns (uint) {
        return tokenStorage.getBalanceOf(_addr);
    }

    function transfer(address _to, uint _value) public returns (bool) {
        if(_value > 0 && _value <= tokenStorage.getBalanceOf(msg.sender)){
            tokenStorage.setBalanceOf(msg.sender,tokenStorage.getBalanceOf(msg.sender) - _value);
            tokenStorage.setBalanceOf(_to, tokenStorage.getBalanceOf(_to) + _value);
            emit Transfer(msg.sender, _to, _value);
            return true;
        }else{
            return false;
        }
    }

}
